        tabl = soup.find('table')
        print(tables)
        tables = tabl.find('tbody')
        #print(tables)
        tabls = tables.find_all('tr')
        for item in tabls:
            text = item.find_all("td")[0].text
            result = text.index('(')
            #print(result)
