    def NMYSQL(self, show_table_query):
        mydb = mysql.connector.connect(
              host=self.HOST,
              user=self.USER,
              passwd=self.PASS,
              database=self.DATABASE
            )
        if mydb.cursor:
            with mydb.cursor() as cursor:
                 cursor.execute(show_table_query)
                 mydb.commit()
